import React from 'react';
import {Link} from 'react-router-dom'

function CustomerInfo({first,last,balance,mail}) {
    return (
        <div>
             <tr>
                    <td>{first}</td>
                    <td>{last}</td>
                    <td>{balance}</td>
                    <td>{mail}</td>
                    <td><Link><button style={{backgroundColor:"rgb(9, 58, 9)"}}>Transfer</button></Link></td>
                </tr>
        </div>
    )
}

export default CustomerInfo
